import React from 'react';
import Project from './Project';
import techBlog from '../assests/techBlog.png';

function Portfolio() {
  return (
    <section id="portfolio">
      <h2 className="page-title">Portfolio</h2>
      <div className="project-list">
        <Project
          title="Tech Blog"
          image={techBlog}
          description="A blogging platform for tech enthusiasts."
          liveLink="https://techblog-ak-22eff5f469ce.herokuapp.com/"
          githubLink="https://github.com/your-username/tech-blog"
        />
        {/* Add more Project components with different props for each project */}
      </div>
    </section>
  );
}

export default Portfolio;
